import { createSlice } from '@reduxjs/toolkit'
export const bankslice= createSlice({
    initialState:810,
    name:"bankslice",
    reducers:{
        WITHDROWMONAY:(state,action)=>{
            return state+action.payload
        },
        WITHDIPOSEDMONAY:(state,action)=>{
            return state-action.payload


        }
    }

})
export const {WITHDROWMONAY,WITHDIPOSEDMONAY}=bankslice.actions
export default bankslice.reducer
